import axios from "../axios";

const getListCustomerForStaff = (data) => {
  //template string
  return axios.get(
    `/api/get-list-customer-for-staff?hotpotId=${data.hotpotId}&date=${data.date}`
  );
};

export { getListCustomerForStaff };
